import Link from 'next/link';
import { Mutation } from 'react-apollo';
import NavStyles from './styles/NavStyles';
import Signout from './Signout';

const Nav = () => (
  <NavStyles data-test="nav">
    <Link href="/aboutus">
      <a>About Us</a>
    </Link>
    <Link href="/cats">
      <a>Meet the Cats</a>
    </Link>
    <Link href="/donation">
      <a>Donation</a>
    </Link>
    <Link href="/adoption">
      <a>Adoption</a>
    </Link>
    <Link href="/signup">
      <a>Sign In</a>
    </Link>
  </NavStyles>
);

export default Nav;
